import { Navbar, Body } from "./components";
import styled from "styled-components";

function App() {
  return (
    <AppContent>
      <Navbar/>
      <Body/>
    </AppContent>
  );
}

const AppContent = styled.body`
  overflow: hidden;
  word-wrap: break-word;
  white-space: pre-wrap;
  word-break: break-word;
`

export default App;
